CREATE TABLE IF NOT EXISTS Agents (
    `Email` VARCHAR(50) CHARACTER SET utf8,
    `FirstName` VARCHAR(25) CHARACTER SET utf8,
    `LastName` VARCHAR(25) CHARACTER SET utf8,
    `SubmissionDate` VARCHAR(30) CHARACTER SET utf8,
    `Expires` DATETIME,
    `Password` VARCHAR(255) CHARACTER SET utf8,
    `AgentToken` VARCHAR(50) CHARACTER SET utf8,
    `PasswordToken` VARCHAR(50) CHARACTER SET utf8,
    `isVerified` CHAR(1) CHARACTER SET utf8,
    `AgentID` INT NOT NULL
);
